import React from 'react'
import ArtData from '../assets/_legacy-art.json'

function SearchGrid() {
    {console.log(ArtData.map((data)=>{return data.properties.image}))}
  return (
    <div className="container mt-5 d-flex align-content-stretch flex-wrap p-4">

         {ArtData.map((data, key) => {
             {console.log("data",data,key)}
                return <SingleCard pic={data.image}  title={data.title} />;
            })} 
    </div>
  )
}

export default SearchGrid
